import React from 'react';
import ButtonLevel from './ButtonLevel';
import './Elevator.scss'



const Elevator = () => {


      return (
            <div className='elevator'>
                  <ButtonLevel children={1} id={1} style="background-color: rgba(18, 216, 147, 0.518);
        border:3px solid red;" />
                  <ButtonLevel children={2} id={2} />
                  <ButtonLevel children={3} id={3} />
                  <ButtonLevel children={4} id={4} />
                  <ButtonLevel children={5} id={5} />
                  <ButtonLevel children={6} id={6} />
                  <ButtonLevel children={7} id={7} />
                  <ButtonLevel children={8} id={8} />

            </div>
      );
}

export default Elevator;
